_pages.productsPage.productList.each(product => {
  let productDetailsLink = product.attr("href");
  let productTitle = product.attr("title");
  cy.visit(productDetailsLink).then(() => {
    _pages.productDetailsPage.breadcrumbProduct.should("include.text", productTitle);
    _pages.productDetailsPage.productTitle.invoke("text").then(text => {
      expect(text).to.be.equal(productTitle);
    });
    _pages.productDetailsPage.variations.find("[for]").should("have.length", 2).and("be.visible");
  });
});
